import React from 'react';
import styled from 'styled-components';
import { 
	CaptionLight,
	CaptionBold,
	Paragraph,
	HeaderSmall,
	HeaderMedium,
	HeaderLarge
 } from 'components/core/Type';

const ResumeSection = styled.section`
	display: flex;
	justify-content: center;
	padding: 2rem;
`;

const ResumeGrid = styled.article`
	display: grid;
	width: 100%;
	max-width: 50rem;
`;

const ResumeHeader = () => (
	<header>
		<HeaderLarge>Resume</HeaderLarge>
	</header>
);

const WorkExperience = () => (
	<HeaderMedium>WorkExperience</HeaderMedium>
);

const Resume = () => (
	<ResumeSection>
		<ResumeGrid>
			<ResumeHeader />
		</ResumeGrid>
	</ResumeSection>
);

export default Resume;
